{
  "proseWrap": "never",
  "singleQuote": true,
  "trailingComma": "es5"
}

{
  "plugins": [
    "stylelint-prettier",
    "stylelint-no-unsupported-browser-features"
  ],
  "extends": [
    "stylelint-config-standard",
    "stylelint-config-sass-guidelines",
    "stylelint-order",
    "stylelint-prettier/recommended"
  ],
  "rules": {
    "selector-class-pattern": [
      "^DocSearch-[A-Za-z0-9-]*$"
    ],
    "prettier/prettier": true,
    "max-nesting-depth": [
      2,
      {
        "ignore": [
          "pseudo-classes"
        ],
        "ignoreAtRules": [
          "media"
        ]
      }
    ],
    "plugin/no-unsupported-browser-features": [
      null,
      {
        "severity": "warning"
      }
    ]
  }
}

{
  "files": [
    {
      "path": "packages/docsearch-css/dist/style.css",
      "maxSize": "3.25 kB"
    },
    {
      "path": "packages/docsearch-react/dist/umd/index.js",
      "maxSize": "27 kB"
    },
    {
      "path": "packages/docsearch-js/dist/umd/index.js",
      "maxSize": "35.08 kB"
    }
  ]
}

import { defineConfig } from 'cypress';

export default defineConfig({
  projectId: 'nf9rdc',
  e2e: {
    baseUrl: 'http://localhost:3000',
    specPattern: 'cypress/e2e/**/*.{js,jsx,ts,tsx}',
  },
});

import algolia from 'eslint-config-algolia/flat/base.js';
import algoliaReact from 'eslint-config-algolia/flat/react.js';
import algoliaTypescript from 'eslint-config-algolia/flat/typescript.js';
import cypresss from 'eslint-plugin-cypress/flat'; // eslint-disable-line import/no-unresolved
import reactRefresh from 'eslint-plugin-react-refresh';
import tseslint from 'typescript-eslint'; // eslint-disable-line import/no-unresolved

export default [
  ...algolia,
  ...algoliaReact,
  ...algoliaTypescript,
  {
    ignores: ['**/node_modules/', '**/dist/', '**/build/', '.yarn/', '**/.docusaurus'],
  },
  {
    plugins: {
      'react-refresh': reactRefresh,
    },
    languageOptions: {
      parserOptions: {
        projectService: true,
      },
    },
    settings: {
      react: {
        pragma: 'React',
        version: 'detect',
      },
      'import/resolver': {
        node: {
          extensions: ['.js', '.ts', '.tsx'],
        },
      },
    },
    rules: {
      'no-param-reassign': 0,
      'valid-jsdoc': 0,
      'no-shadow': 0,
      'prefer-template': 0,
      'react/prop-types': 0,
      'react/no-unescaped-entities': 0,
      'import/extensions': 0,
      'no-unused-expressions': 0,
      complexity: 0,
      'import/order': [
        'error',
        {
          alphabetize: {
            order: 'asc',
            caseInsensitive: true,
          },
          'newlines-between': 'always',
          groups: ['builtin', 'external', 'parent', 'sibling', 'index'],
          pathGroups: [
            {
              pattern: '@/**/*',
              group: 'parent',
              position: 'before',
            },
          ],
          pathGroupsExcludedImportTypes: ['builtin'],
        },
      ],

      // TMP
      'react/function-component-definition': ['off'],
      'react/jsx-filename-extension': ['off'],
      'jsdoc/check-examples': ['off'],
    },
  },
  {
    files: ['**/*.js'],
  },
  tseslint.configs.disableTypeChecked,
  {
    files: ['cypress/**/*'],
    plugins: {
      cypresss,
    },
    rules: {
      '@typescript-eslint/triple-slash-reference': 0,
    },
  },
  {
    files: ['packages/website/**/*'],
    rules: {
      'import/no-unresolved': 0,
      'import/no-extraneous-dependencies': 0,
    },
  },
  {
    files: ['examples/demo/**/*'],
    rules: {
      'react/react-in-jsx-scope': 0,
    },
  },
];

{
  "packages": [
    "packages/*",
    "examples/*"
  ],
  "version": "3.8.2",
  "npmClient": "yarn"
}

{
  "$schema": "https://docs.renovatebot.com/renovate-schema.json",
  "extends": [
    "config:js-lib",
    "github>algolia/renovate-config-algolia"
  ],
  "baseBranches": [
    "chore/renovateBaseBranch"
  ],
  "packageRules": [
    {
      "packagePatterns": [
        "^@types"
      ],
      "depTypeList": [
        "devDependencies"
      ],
      "rangeStrategy": "replace"
    }
  ],
  "prHourlyLimit": 20
}

import { babel } from '@rollup/plugin-babel';
import json from '@rollup/plugin-json';
import resolve from '@rollup/plugin-node-resolve';
import replace from '@rollup/plugin-replace';
import terser from '@rollup/plugin-terser';
import { dts } from 'rollup-plugin-dts';
import filesize from 'rollup-plugin-filesize';

export const plugins = [
  replace({
    preventAssignment: true,
    __DEV__: JSON.stringify(process.env.NODE_ENV === 'development'),
  }),
  json(),
  resolve({
    extensions: ['.js', '.jsx', '.ts', '.tsx', '.json'],
    browser: true,
  }),
  babel({
    babelHelpers: 'bundled',
    exclude: 'node_modules/**',
    extensions: ['.js', '.jsx', '.ts', '.tsx', '.json'],
    rootMode: 'upward',
  }),
  terser(),
  filesize({
    showMinifiedSize: false,
    showGzippedSize: true,
  }),
];

export const typesConfig = {
  input: 'dist/esm/types/index.d.ts',
  output: [{ file: 'dist/esm/index.d.ts', format: 'es' }],
  plugins: [dts()],
};

import fs from 'fs';
import path from 'path';

const packages = ['packages/docsearch-css', 'packages/docsearch-react', 'packages/docsearch-js'];

export default {
  monorepo: {
    mainVersionFile: 'lerna.json',
    // We rely on Lerna to bump our dependencies.
    packagesToBump: [],
    packagesToPublish: packages,
  },
  publishCommand({ tag }) {
    return `npm publish --tag ${tag}`;
  },
  versionUpdated({ exec, dir, version }) {
    // Update package dependencies
    exec(`yarn lerna version ${version} --exact --no-git-tag-version --no-push --yes`);

    // Ship.js reads JSON and writes with `fs.writeFileSync(JSON.stringify(json, null, 2))`
    // which causes a lint error in the `lerna.json` file.
    exec('yarn eslint lerna.json --fix');

    fs.writeFileSync(
      path.resolve(dir, 'packages', 'docsearch-react', 'src', 'version.ts'),
      `export const version = '${version}';\n`,
    );
  },
};

{
  "extends": "./tsconfig",
  "compilerOptions": {
    "noEmit": false,
    "declaration": true,
    "emitDeclarationOnly": true
  }
}

import { defineConfig } from 'vitest/config';

export default defineConfig({
  test: {
    environment: 'jsdom',
    setupFiles: ['./scripts/setupTests.ts'],
  }
});
